import React from "react";
import Footer from "../Bases/Footer";
import Header from "../Bases/Header";

export default class AppLayout extends React.Component{
    render() {
        return(
            <div className="layout-container">
                <Header/>
                {this.props.children}
                <Footer/>
                </div>
        )
    }
}
